import './Background.scss';
import gradient from '../assets/gradient.png';
import { useEffect } from 'react';
import './grained';

export default function Background() {

    useEffect(() => {
        window.grained('#background', {
            "animate": false,
            "grainOpacity": 1
        }); 
    });

    return (
        <div id='background'>
            <img className='grained' id='gradient' src={gradient} />
        </div>
    );
}
